script: |
  super -f text -I q10929.spq | sort > q10929.out

inputs:
  - name: q10929.spq
    data: |
      SELECT ALL + col2 * col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 NOT BETWEEN + col1 AND - + ( - col1 ) * - col2 + + + col2 + - 49 / - col2;
  - name: tab1

outputs:
  - name: q10929.out
    data: |
      4896
      5015
      6188
